import React from 'react';
import { Route, Navigate } from 'react-router-dom';

const PrivateRoute = ({ element, isAuthenticated, ...rest }) => {
    return isAuthenticated ? (
      <React.Fragment>{element}</React.Fragment>
    ) : (
      <Navigate to="/login" />
    );
  };

export default PrivateRoute;
